<head>

  <title>Video Player with Dynamic Source</title>
  <!-- Include Tailwind CSS resources -->
  <link href="https://cdn.jsdelivr.net/npm/tailwindcss@2.2.16/dist/tailwind.min.css" rel="stylesheet">
  <script disable-devtool-auto src='#https://cdn.jsdelivr.net/npm/disable-devtool@latest'></script>
  <style>
    .flex {
      display: flex;
      justify-content: space-between;
      /* Adjust alignment as needed */
      align-items: center;
      /* Center vertically within the div */
    }

    button {
      flex: 1;
      margin: px;
      width: 100%;
      /* Ensure buttons take up 100% of available width */
      height: 100%;
      /* Ensure buttons take up 100% of available height */
    }

    .videoplayer {
      background-color: #f0f0f0;
      /* Change to your desired background color */
      /* OR */
      background-image: url('your-background-image.jpg');
      /* Replace with your image path */
      background-size: cover;
      /* Ensure the image covers the container */

    }

    .Body {
      width: 100%;
      box-shadow: 9px 9px 8px #8c8c8c,
        -29px -29px 58px #ffffff;
      border-radius: 10px;
      overflow: hidden;

    }

    .animate {
      transition: all 0.1s;
      -webkit-transition: all 0.1s;
    }

    .action-button {
      position: relative;
      padding: 5px 10px;
      margin: 0px 10px 10px 0px;
      float: center;
      border-radius: 8px;
      font-family: 'Rubik', sans-serif;
      font-size: 20px;
      color: #FFF;
      text-decoration: none;
    }

    .blue {
      background-color: #3498DB;
      border-bottom: 5px solid #2980B9;
      text-shadow: 0px -2px #2980B9;
    }

    .red {
      background-color: #E74C3C;
      border-bottom: 5px solid #BD3E31;
      text-shadow: 0px -2px #BD3E31;
    }

    .green {
      background-color: #82BF56;
      border-bottom: 5px solid #669644;
      text-shadow: 0px -2px #669644;
    }

    .yellow {
      background-color: #F2CF66;
      border-bottom: 5px solid #D1B358;
      text-shadow: 0px -2px #D1B358;
    }

    .action-button:active {
      transform: translate(0px, 5px);
      -webkit-transform: translate(0px, 5px);
      border-bottom: 1px solid;
    }
  </style>
</head>
